import NavBar from "./Nav"
import Footer from "./Footer"

function App() {

  return (
    <>
    <ul class = "top">< NavBar /></ul>
    <ul class = "bottom">
    < Footer />
    <p>Nicholas Hughes </p>
    </ul>
    </>
  );

}

export default App;
